export default {
	/**
	* Drawing a horizontal line
	*/
	horizontalLine(pdf, headerHeight) {
		const lineLength = Math.round(pdf.internal.pageSize.width) - 15;
		const lineWidth = 0.01;

		// Define the color of the line (gray)
		const lineColor = [222, 222, 222];

		// Set the color of the line
		pdf.setDrawColor(lineColor[0], lineColor[1], lineColor[2]);

		// Adding a horizontal line
		pdf.setLineWidth(lineWidth);
		pdf.line(15, headerHeight, lineLength, headerHeight);
	},

	/**
	* Setting pagination on each page in a pdf file
	*/
	pagination(pdf) {
		// Getting the number of pages
		const pageCount = pdf.internal.getNumberOfPages();

		// Iterating over each page and adding the numbering
		for (let i = 1; i <= pageCount; i++) {

			// Move to the current page
			pdf.setPage(i);

			// Calculating the current page number and the total number of pages
			let pageNumber = i;
			const totalPages = pageCount;

			// Create text with page numbering
			const pageText = `${pageNumber} / ${totalPages}`;
			pdf.setFontSize(10);
			pdf.setFont('Arial','normal');

			// Calculating the width of text with pagination
			const textWidth = pdf.getTextDimensions(pageText).w;

			// Set the position of the text on the right side
			const pageWidth = pdf.internal.pageSize.width;
			let xPos = (pageWidth - textWidth) - 10;

			// Adding page numbering on the page
			pdf.text(pageText, xPos, pdf.internal.pageSize.height - 10);

		}
	},

	async onClickGeneratePdfBtn () {
		const pdf = new jspdf.jsPDF();
		const logoBase64 = 'data:image/png;base64,';
		const xPosition = 178;
		const yPosition = 12;
		let headerHeight = 0;
		pdf.addImage(logoBase64, 'PNG', xPosition, yPosition, 24, 34);
		pdf.setFontSize(14);
		const widthPage = pdf.internal.pageSize.width - 30;

		pdf.setFont('Arial','normal');
		const workordersInformationHeaderLabel = pdf.splitTextToSize(`${TextJS[appsmith.store.LANG].PDF.WORKORDER_NAME}:`, widthPage, {align: 'justify'});
		const heightWorkordersInformationHeaderLabel = Math.round(pdf.getTextDimensions(workordersInformationHeaderLabel).h);
		headerHeight += 15;
		pdf.text(workordersInformationHeaderLabel, 15, headerHeight);

		pdf.setFont('Arial','bold');
		const workordersInformationHeaderValue = pdf.splitTextToSize(`${appsmith.store.WORKORDER.workorderName}`, widthPage, {align: 'justify'});
		const heightWorkordersInformationHeaderValue = Math.round(pdf.getTextDimensions(workordersInformationHeaderValue).h);
		headerHeight += heightWorkordersInformationHeaderLabel + 5;
		pdf.text(workordersInformationHeaderValue, 15, headerHeight);

		pdf.setFont('Arial','normal');
		const stationsInformationHeaderLabel = pdf.splitTextToSize(`${TextJS[appsmith.store.LANG].PDF.STATION_NAME}:`, widthPage, {align: 'justify'});
		const heightStationsInformationHeaderLabel = Math.round(pdf.getTextDimensions(stationsInformationHeaderLabel).h);
		headerHeight += heightWorkordersInformationHeaderValue + 5;
		pdf.text(stationsInformationHeaderLabel, 15, headerHeight);

		pdf.setFont('Arial','bold');
		const stationsInformationHeadeValue = pdf.splitTextToSize(`${appsmith.store.STATION_SELECTION.stationName}`, widthPage, {align: 'justify'});
		const heightStationsInformationHeaderValue = Math.round(pdf.getTextDimensions(stationsInformationHeadeValue).h);
		headerHeight += heightStationsInformationHeaderLabel + 5;
		pdf.text(stationsInformationHeadeValue, 15, headerHeight);

		headerHeight += heightStationsInformationHeaderValue + 5;

		let nameLabel = `${TextJS[appsmith.store.LANG].SETUP_LIST.PART_NAME}:`;
		let nameValue = "";
		let splitNameLabel = "";
		let splitNameValue = "";
		let descLabel = `${TextJS[appsmith.store.LANG].SETUP_LIST.PART_DESCRIPTION}:`;
		let descValue = "";
		let splitDescLabel = "";
		let splitDescValue = "";
		let QuantityLabel = `${TextJS[appsmith.store.LANG].SETUP_LIST.QUANTITY}:`;
		let UnitLabel = `${TextJS[appsmith.store.LANG].SETUP_LIST.UNIT}:`;
		let splitQuantityValue = "";
		let quantityValue = "";
		let splitQuantityLabel = "";
		let splitUnitLabel = "";
		let unitValue = "";
		let splitUnitValue = "";

		/**
		* Setting the label column width
		*/
		const labelColumnWidth = 40;
		/**
		* Setting the value column width
		*/
		const valueColumnWidth = Math.round(pdf.internal.pageSize.width) - labelColumnWidth - 50;
		pdf.setFontSize(12);
		this.horizontalLine(pdf, headerHeight);
		let heightAllContent = headerHeight;
		const heightOfTheEntirePageAvailableForContent = Math.round(pdf.internal.pageSize.height) - 40;
		const maxColumnWidth = 50;
		const maxLeftWidth = (pdf.internal.pageSize.width - 38) / 4;

		for (let index = 0; index < SetupListInNewTabJS.dataSetupListToDisplay.length; index++) {
			splitNameLabel = pdf.splitTextToSize(nameLabel, labelColumnWidth, { align: 'justify' });
			nameValue = SetupListInNewTabJS.dataSetupListToDisplay[index]['materialPart'].name;
			splitNameValue = pdf.splitTextToSize(nameValue, maxColumnWidth, valueColumnWidth, { align: 'justify' });
			splitDescLabel = pdf.splitTextToSize(descLabel, labelColumnWidth, { align: 'justify' });
			descValue = SetupListInNewTabJS.dataSetupListToDisplay[index]['materialPart'].i18n.description.en;
			splitDescValue = pdf.splitTextToSize(descValue, maxColumnWidth, valueColumnWidth, { align: 'justify' });
			splitQuantityLabel = pdf.splitTextToSize(QuantityLabel, labelColumnWidth, { align: 'justify' });
			quantityValue = SetupListInNewTabJS.dataSetupListToDisplay[index].workorderWorkstepBomItem['quantity'].value;
			splitQuantityValue = pdf.splitTextToSize(quantityValue, maxLeftWidth, valueColumnWidth, { align: 'justify' });
			splitUnitLabel = pdf.splitTextToSize(UnitLabel, labelColumnWidth, { align: 'justify' });
			unitValue = SetupListInNewTabJS.dataSetupListToDisplay[index].workorderWorkstepBomItem['quantity'].unit;

			unitValue = (unitValue === "") ? "Piece" : unitValue;
			splitUnitValue = pdf.splitTextToSize(unitValue, maxLeftWidth, valueColumnWidth, { align: 'justify' });

			let someSingleLineHeight = Math.round(pdf.getTextDimensions(splitDescLabel).h);
			let nameHeight = Math.round(pdf.getTextDimensions(splitNameValue).h) ;
			let quantityHeight = Math.round(pdf.getTextDimensions(splitQuantityValue).h);
			let descHeight = Math.round(pdf.getTextDimensions(splitDescValue).h);
			let unitHeight = Math.round(pdf.getTextDimensions(splitUnitValue).h);
			let maxValueNameOrQuantity = Math.max(nameHeight, quantityHeight);
			let maxValueDescOrUnit = Math.max(descHeight, unitHeight);

			/**
			* Add next page
			*/
			if(heightOfTheEntirePageAvailableForContent < ( heightAllContent + Math.round(pdf.getTextDimensions(splitNameValue).h) + Math.round(pdf.getTextDimensions(splitDescValue).h))) {
				pdf.addPage();
				heightAllContent = 15;
				this.horizontalLine(pdf, heightAllContent);
			}

			/**
			* Fill with content
			*/
			const leftColumnXPosition = 20;
			const columnWidth = (pdf.internal.pageSize.width - 40) / 2;
			let rightColumnXPosition = leftColumnXPosition + columnWidth + 20;

			pdf.setFont('Arial','normal');
			heightAllContent += 10;
			pdf.text(splitNameLabel, leftColumnXPosition, heightAllContent);
			pdf.setFont('Arial','bold');
			pdf.text(splitNameValue, leftColumnXPosition + labelColumnWidth, heightAllContent);

			pdf.setFont('Arial','normal');
			pdf.text(splitQuantityLabel, rightColumnXPosition - 5, heightAllContent);
			pdf.setFont('Arial','bold');
			pdf.text(splitQuantityValue, rightColumnXPosition + labelColumnWidth - 17, heightAllContent);

			if (maxValueNameOrQuantity >= 4) {
				heightAllContent += Math.round(maxValueNameOrQuantity) + 5;
			}
			if (maxValueNameOrQuantity == 0 ) {
				heightAllContent += someSingleLineHeight + 5;
			}

			if (descValue !== "") {
				pdf.setFont('Arial','normal');
				pdf.text(splitDescLabel, 20, heightAllContent);
				pdf.setFont('Arial','bold');
				pdf.text(splitDescValue, 10 + labelColumnWidth + 10, heightAllContent);
			}

			pdf.setFont('Arial','normal');
			pdf.text(splitUnitLabel, rightColumnXPosition - 5, heightAllContent);
			pdf.setFont('Arial','bold');
			pdf.text(splitUnitValue, rightColumnXPosition + labelColumnWidth - 17, heightAllContent);

			heightAllContent += maxValueDescOrUnit + 5;
			this.horizontalLine(pdf, heightAllContent);
		}
		this.pagination(pdf)
		/**
		* Generation of a pdf file with data
		*/
		await download(pdf.output(),`setup-list-${appsmith.store.WORKORDER.workorderName}.pdf`);
	}
}